import React,{useState} from 'react'

import IDataCardSection from '../Data/IDataCardSection'
import IDataOrderItem from '../Data/IDataOrderItem'
import Divider from '@material-ui/core/Divider';
import ViewCard from './ViewCard'


import Card from '@material-ui/core/Card'
import CardHeader from '@material-ui/core/CardHeader'
import CardContent from '@material-ui/core/CardContent'

import IconButton from '@material-ui/core/IconButton'
import MoreVertIcon from '@material-ui/icons/MoreVert';

interface IDataVSM
{
    name?: string,
    TActual: number,
    TPlan?: number,
    sections: IDataCardSection[]
}


const ViewOrderCard =  (props: {data : IDataVSM[],productionId: number}) => {
    const [BDitems, setBDItem] = useState<IDataOrderItem[]>();


    let listProduct = props.data.map((item: IDataVSM, index: number)=>{


        return(
            <Card key={index} sx={{marginBottom: '150px'}}>
                <CardHeader
                    action={
                        <IconButton aria-label="settings">
                            <MoreVertIcon />
                        </IconButton>
                    }
                    title='123'
                    subheader="Время цикла: "
                    sx={{fontWeight: 'bold', color:'white'}}
                >
                </CardHeader>
                <CardContent sx={{backgroundColor: 'rgba(0, 0, 0, .03)'}}>
                    <ViewCard sections={item.sections}/>
                </CardContent>
            </Card>

        )
    })
    return(
       <div>
           {listProduct}
       </div>
    )

}


export default ViewOrderCard;
